import { SIGNUP } from '../actions/types';

const usersReducer = (state = {}, action) => {
  switch (action.type) {
    case SIGNUP:
      console.log('signup working in usersReducer');
      return {
        ...state,
        // error: action.payload,
      };
    default:
      return state;
  }
};
export default usersReducer;
